import React, { useState } from "react";
import { Typography, TextField, Button, Toolbar, Container } from "@mui/material";
import Navbar from "./Navbar";

export default function MoviePage() {
  return (
    <div>
      <Navbar />
      <Toolbar />
      <Container>
        <Typography variant="h5">Movie Page</Typography>
      </Container>
    </div>
  );
}
